//import './App.css';
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Inicio from "./components/InicioL";
import Tienda from "./components/Tienda";
import Login from "./components/Login";
import Factura from "./components/Factura";
import GestionClientes from "./screens/GestionClientes";
import CreateCliente from "./components/cliente/CreateCliente";

function App() {

  return (
    <div className="App">

      <Router>
        <Routes>
          <Route path="/" element={<Inicio />} />
          <Route path="/inicio" element={<Inicio />} />
          <Route path="/tienda" element={<Tienda />} />
          <Route path="/login" element={<Login />} />
          <Route path="/factura" element={<Factura />} />
          {/* SOlo para Adiministrador */}
          <Route path="/gestionClientes" element={<GestionClientes />} />
          <Route path="/createCliente" element={<CreateCliente />} />
          <Route path="/editCliente/:id" element={<CreateCliente />} />
        </Routes>
      </Router>

    </div>
  );
}



export default App;
